window.bookSummaryJSON = "<p><b>He's spent his life devoted to his goddess. It's time he worships someone new. Me.</b></p> <p>When his unit brought the wounded warrior, Guilri, to my camp, I had no choice but to heal him.</p> <p><i>It would be inhumane to let someone so hot die.</i></p> <p>As he came back to life, I realized my mistake. He was a threat. Not to my body . . . <i>but to my walled off heart</i>.</p> <p>Only Guilri has been strong enough to tear down my barriers to love. But the goddess he fights for is a vengeful deity. She will not sit idly by as her champion finds love in the arms of a human woman.</p> <p>She will force him to choose . . . <i>His destiny. Or his heart?</i></p> <p>Contains mature themes.</p>"; 
